import React, { FC } from 'react';

// style
import './Strategy.scss';

interface StrategyProps {}

const Strategy: FC<StrategyProps> = () => { 



  return (
    <>   
      <div className="strategy" data-testid="strategy">
        <button>HIT</button>
        <button>STAND</button>
        <button>DOUBLE</button>
        <button>SPLIT</button>
        <button>SP/H</button>
        <button>SU/H</button>
      </div>
    </>
  );
};

export default React.memo(Strategy);
